import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the first product card to open the modal
    // The JavaScript populates the grid, so we wait for the card to be available.
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const firstProductCard = page.locator('.product-card').first();
    await firstProductCard.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Wait for the modal content to be visible
    const modalTitleSelector = '.product-detail-title';
    await page.waitForSelector(modalTitleSelector, { state: 'visible', timeout: 5000 });

    // Take a screenshot of the visible modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_visible.png'));

    // Extract data from the modal to verify
    const productTitle = await page.locator(modalTitleSelector).textContent();
    const productPrice = await page.locator('.product-detail-price').textContent();

    return {
      success: true,
      action: "Opened the product detail modal by clicking the first product card.",
      extractedData: {
        productTitle: productTitle.trim(),
        productPrice: productPrice.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
